import React from "react";
import Button from "./Button";

export default class ButtonGrid extends React.Component {
    render() {
        return (
            <table>
                <tbody>
                    <tr>
                        <td><Button content='0' /></td>
                        <td><Button content='1' /></td>
                        <td><Button content='2' /></td>
                        <td><Button content='3' /></td>
                    </tr>
                    <tr>
                        <td><Button number='4' /></td>
                        <td><Button number='5' /></td>
                        <td><Button number='6' /></td>
                        <td><Button number='7' /></td>
                    </tr>
                    <tr>
                        <td><Button number='+' /></td>
                        <td><Button number='-' /></td>
                        <td><Button number='/' /></td>
                        <td><Button number='*' /></td>
                    </tr>
                </tbody>
            </table>

        );
    }
}
